import './servicePage.scss';
import { useState, useEffect, useCallback, useRef } from 'react';
import Header from '../header/header';
import ServiceItem from '../serviceItem/serviceItem';
import { Link } from 'react-router-dom';


const ServicePage = (): JSX.Element => {

    const ref1 = useRef<HTMLDivElement>(null);
    const ref2 = useRef<HTMLDivElement>(null);
    const ref3 = useRef<HTMLDivElement>(null);
    const ref4 = useRef<HTMLDivElement>(null);
    const ref5 = useRef<HTMLDivElement>(null);

    const [serviceActive, setServiceActive] = useState<number>(1);

    const scrollHandler = useCallback(() => {
        if (ref1 && ref1.current && window.pageYOffset + window.innerHeight * 2/3 >= ref1.current.offsetTop) {
            setServiceActive(1);
        }
        if (ref2 && ref2.current && window.pageYOffset + window.innerHeight * 2/3 >= ref2.current.offsetTop) {
            setServiceActive(2);
        }
        if (ref3 && ref3.current && window.pageYOffset + window.innerHeight * 2/3 >= ref3.current.offsetTop) {
            setServiceActive(3);
        }
        if (ref4 && ref4.current && window.pageYOffset + window.innerHeight * 2/3 >= ref4.current.offsetTop) {
            setServiceActive(4);
        }
        if (ref5 && ref5.current && window.pageYOffset + window.innerHeight * 2/3 >= ref5.current.offsetTop) {
            setServiceActive(5);
        }

    }, []);

    useEffect(() => {

        window.addEventListener('scroll', scrollHandler);

        return () => {
            window.removeEventListener('scroll', scrollHandler);
        }
    }, [scrollHandler]);

    return (
        <>
            <Header dark={false} />
            <div className="servicePage">
                <div className="servicePage__tiles">
                    <div className={`servicePage__tiles__wrapper ${serviceActive === 3 ? "servicePage__tiles__wrapper--scrollUp" : ""} ${serviceActive >= 4 ? "servicePage__tiles__wrapper--scrollUpUp" : ""}`}>
                        <div className={`servicePage__tiles__wrapper__tile ${serviceActive === 1 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>Web</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serviceActive === 2 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>App</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serviceActive === 3 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>Cloud</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serviceActive === 4 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>AI</span></div>
                        <div className={`servicePage__tiles__wrapper__tile ${serviceActive === 5 ? "servicePage__tiles__wrapper__tile--active" : ""}`}><span>New</span></div>
                    </div>
                </div>
                <div className="servicePage__text">
                    <div ref={ref1} className="servicePage__text__wrapper">
                        <ServiceItem classNameAdded={serviceActive === 1 ? "serviceItem--active" : ""} title={<>Do you need help with builidng your website?</>} text={<>We build can build your website using technologies such as PHP or React.</>} />
                    </div>
                    <div ref={ref2} className="servicePage__text__wrapper">
                        <ServiceItem classNameAdded={serviceActive === 2 ? "serviceItem--active" : ""} title={<>App development</>} text={<>Is a hybrid solution better then a native solution for your organisation?<br />We can help you with building an App suited for your goals.</>} />
                    </div>
                    <div ref={ref3} className="servicePage__text__wrapper">
                        <ServiceItem classNameAdded={`${serviceActive === 3 ? "serviceItem--active" : ""}`} title={<>Fascinated about the Cloud?</>} text={<>We are fascinated about the Cloud and it's possibilities. Helping organisations to make use of this potential is what we want to do.</>} />
                    </div>
                    <div ref={ref4} className="servicePage__text__wrapper">
                        <ServiceItem classNameAdded={`${serviceActive === 4 ? "serviceItem--active" : ""}`} title={<>Artificial intelligence</>} text={<>We help organisations use the full potential of all it's data by using AI. Is your organisation ready for it?</>} />
                    </div>
                    <div ref={ref5} className="servicePage__text__wrapper">
                        <ServiceItem classNameAdded={serviceActive === 5 ? "serviceItem--active" : ""} title={<>Unknown</>} text={
                            <div>
                                <div>
                                    <span>Looking for something new in the digital domain or need advise?</span>
                                </div>
                                <div className="newService__contact">
                                    <Link to="/contact">
                                        <span>Lets talk</span>
                                        <span></span>
                                    </Link>
                                </div>
                            </div>
                        } />
                    </div>
                </div>
            </div>
        </>
    );
}

export default ServicePage;
